app = {}

// 1. populate dropdown
app.populate_dropdown = function() {
    // extract all keys from df object
    keys = Object.keys(app.df[0]);
    // replace country code with country name   
    new_keys = keys.slice(0,80);
    world_bank = keys.slice(80,1360);

    for (i=0; i<world_bank.length; i++) {
        new_item = `${world_bank[i].substring(0, world_bank[i].length-3)} - ${app.country_name[world_bank[i].substring(world_bank[i].length-3)]}`;
        new_keys.push(new_item);
    
    }
    $('.selectVal').empty();
    for (i=0; i<new_keys.length; i++) {
        $('.selectVal').append($('<option></option>').val(keys[i]).html(new_keys[i]))
    }
    // $.each(keys, function(i, p) {
    //     $('.selectVal').append($('<option></option>').val(p));
    // });  
    // $.each(new_keys, function(i, p) {
    //     $('.selectVal').append($('<option></option>').html(p));
    // });    
}

// 2. Extract values from df object

app.value_extraction = function(attribute) {
    let x = [];
    let year = [];
    for (i=0; i<app.df.length;i++) {
        x.push(app.df[i][attribute]);
        year.push(app.df[i]['Year'])
    }
    return {'x': x,
            'year': year};
}

// 3. remove missing values

app.remove_missing_values = function(series1, series2) {    
    // remove missing values from series1 & series2
    let x = []
    let y = []
    let yr = []
    max_length = Math.max(series1.x.length, series2.x.length);
    for (i=0; i<max_length;i++) {
        if ( series1.x[i] !== null && series2.x[i] !== null) {
            x.push(series1.x[i]);
            y.push(series2.x[i]);
            yr.push(series1.year[i])
        }
    }
    return {'x': x, 
            'y': y,
            'year': yr}
}

// 4. calculate PeUS arson correlation
app.correlation = function(x, y) {
    // r = SUM OF (x-x_mean) * (y-y_mean)/SQRT OF SUM(x-x_mean)^2*(y-y_mean)^2
    // calculate x and y mean
    let mean = (array) => array.reduce((a, b) => a + b) / array.length;
    const x_mean = mean(x);
    const y_mean = mean(y);
    
    // correlation
    numerator = 0
    xx_denominator = 0
    yy_denominator = 0
    for (i=0; i< x.length; i++){
        numerator += (x[i]-x_mean)*(y[i]-y_mean);
        xx_denominator += Math.pow((x[i]-x_mean),2);
        yy_denominator += Math.pow((y[i]-y_mean),2);
    }    
    avg = numerator / Math.pow(xx_denominator*yy_denominator, 0.5);
    return avg;
}

// 5. draw chart using google charts
app.create_google_chart = function() {
    $('.google-chart').show();
    const s1 = $('.s1').val();
    const s2 = $('.s2').val();
    // get values
    s1_val = app.value_extraction(s1);
    s2_val = app.value_extraction(s2);

    data = app.remove_missing_values(s1_val, s2_val);
    x = data.x
    y = data.y
    year = data.year

    // get correlation
    corr = app.correlation(x, y);

    google.charts.load('current', {'packages':['corechart']});
    google.charts.setOnLoadCallback(drawChart);

    let dataArray = [['Year', s1, s2]];
    for (i=0; i<x.length; i++) {
        dataArray.push([year[i].toString(), x[i], y[i]]);
    }
    console.log(dataArray);

    function drawChart() {
      var data = google.visualization.arrayToDataTable(dataArray);

      var options = {
        title: `${s1} vs ${s2}. Corr = ${corr.toFixed(3)}`,
        curveType: 'function',
        hAxis: {title: 'Years',
                slantedText: true,
                slantedTextAngle: 45},
        legend: { position: 'bottom' },
        vAxes: {0: {logScale: false},
                1: {logScale: false, maxValue: 2}},
        series:{
                0:{targetAxisIndex:0},
                1:{targetAxisIndex:1},
                2:{targetAxisIndex:1}
            },
        vAxes: {
            0: {title: `${s1}`},
            1: {title: `${s2}`}
            }
        };

      var chart = new google.visualization.LineChart(document.getElementById('curve_chart'));
      
      chart.draw(data, options);

    }
    $(window).resize(function(){
        drawChart();
    });
}

app.init = function() {
    app.populate_dropdown();
    $('.see-more-btn1').click(function() {
        try {
            app.create_google_chart();
        }
        catch(err) {
            alert('Something went wrong :-(');
        }   
    });
}

$(function() {
    app.init();
});

